import Dashboard from "views/Dashboard.js";
import Icons from "views/Icons.js";
import Map from "views/Map.js";
import Notifications from "views/Notifications.js";
import Rtl from "views/Rtl.js";
import Tables from "views/TableList.js";
import Typography from "views/Typography.js";
import UserProfile from "views/UserProfile.js";
// import Details from "views/Details";
import AddMaterial from "views/AddMaterial.js";
import AddProduct from "views/AddProduct.js";

var routes = [
  {
    path: "/dashboard",
    name: "Dashboard",
    rtlName: "dashboard",
    icon: "tim-icons icon-chart-pie-36",
    component: <Dashboard />,
    layout: "/admin",
  },
  {
    path: "/icons",
    name: "Icons",
    rtlName: "icons",
    icon: "tim-icons icon-atom",
    component: <Icons />,
    layout: "/admin",
  },
  {
    path: "/map",
    name: "Map",
    rtlName: "mao",
    icon: "tim-icons icon-pin",
    component: <Map />,
    layout: "/admin",
  },
  {
    path: "/notifications",
    name: "Notifications",
    rtlName: "notifications",
    icon: "tim-icons icon-bell-55",
    component: <Notifications />,
    layout: "/admin",
  },
  {
    path: "/user-profile",
    name: "User Profile",
    rtlName: "user-profile",
    icon: "tim-icons icon-single-02",
    component: <UserProfile />,
    layout: "/admin",
  },
  {
    path: "/tables",
    name: "Table List",
    rtlName: "tables",
    icon: "tim-icons icon-puzzle-10",
    component: <Tables />,
    layout: "/admin",
  },
  {
    path: "/typography",
    name: "Typography",
    rtlName: "typography",
    icon: "tim-icons icon-align-center",
    component: <Typography />,
    layout: "/admin",
  },
  // {
  //   path: "/rtl-support",
  //   name: "RTL Support",
  //   rtlName: "rtl-support",
  //   icon: "tim-icons icon-world",
  //   component: <Rtl />,
  //   layout: "/rtl",
  //   target: "_blank",
  // },
  {
    path: "/addmaterial",
    name: "Add Material",
    rtlName: "add-material",
    icon: "tim-icons icon-simple-add",
    component: <AddMaterial />,
    layout: "/admin",
  },
  {
    path: "/addproduct",
    name: "Add Product",
    rtlName: "add-product",
    icon: "tim-icons icon-simple-product",
    component: <AddProduct />,
    layout: "/admin",
  },
];
export default routes;
